import './Header.css';

import logo from '../../assets/logo.png';

const Header = () => {
    return (
        <div className='header_container'>
            <div className='header'>
                <div className='header_left'>
                    <img src={ logo } className='header_left_logo' alt="Shocker Pools logo" />
                </div>
                <div className='header_middle'>Links</div>
                <div className='header_right'>
                    <input placeholder="Search..." type='text' className='header_search_bar' />
                    <button className='header_search_button'>Search</button>
                </div>
            </div>
            <div className='header_bottom'>
                Bottom
            </div>
        </div>
    );
}

export default Header;
